#include <iostream>
#include <vector>
#include <algorithm>
using namespace std;
 
class MountainWalk{
  public:
    int cellsVisited(vector <string> AM, int hD){
      int st [51][51];
      for(int i=0;i<51;i++)
        for(int j=0;j<51;j++)
          st[i][j]=0;
      int x=0,y=0;
      int cnt=1;
      int maxX=AM.size(),maxY = AM[0].size();
      int v = 0;
      bool end=true;
      st[0][0] = 1;
      while(18){
        v = AM[x][y]-'0';
        if(x+1<maxX&&st[x+1][y]==0&&abs((AM[x+1][y]-'0')-v)<=hD){
          ++cnt;
          st[x+1][y]=1;
          ++x;
          end= false;
        }  
        else if(y-1>=0&&st[x][y-1]==0&&abs((AM[x][y-1]-'0')-v)<=hD){
          ++cnt;
          st[x][y-1]=1;
          --y;
          end= false;
        }
        else if(x-1>=0&&st[x-1][y]==0&&abs((AM[x-1][y]-'0')-v)<=hD){
          ++cnt;
          st[x-1][y]=1;
          --x;
          end= false;
        }
        else if(y+1<maxY&&st[x][y+1]==0&&abs((AM[x][y+1]-'0')-v)<=hD){
          ++cnt;
          st[x][y+1]=1;
          ++y;
          end= false;
        }
        if(end)
          break;
        end = true;
      }
      return cnt;
    }
};
 
 
